import React, { useState } from "react";
import { motion } from "framer-motion";
import "./Header.scss";

export default function Header() {
  return (
    <div className='app__header app__flex' id='header'>
      <motion.div whileInView={{ x: [-100, 0], opacity: [0, 1] }} transition={{ duration: 2 }} className='app__header-info'>
        <div className='app__header-badge'>

          <div className='badge-cmp app__flex'>
            <h1 className='head-text-main'>Hi, I'm Andras</h1>
          </div>

          <div className='tag-cmp app__flex'>
            <h2 className="head-text-desc">Web Developer</h2>
          </div>

        </div>
      </motion.div>
    </div>
  )
}
